.lobbyBtn {
    width: 60px;
    height: 60px;
    position: absolute;
    right: 0;
    top: 0;
    margin-top: 20px;
    margin-right: 20px;
    border-radius: 50%;
    background-color: #763a00;
    padding: 0;
    border: 0;
}

.lobbyBtn:hover {
    background-color: #fca14c;
}

.lobbyBtn:active {
    background-color: #4b4b4b;
}
